export default function updateStudentGradeByCity(listStudents, city, newGrades) {
  let gradedStudents = [];
  newGrades.forEach((x) => {
    let student = listStudents.filter((y) => y.id === x.studentId);
    student.grade = x.grade;
    gradedStudents.push(student);
  })
  return gradedStudents.filter((x) => x.location === city);
}

